import { Link } from 'react-router-dom';

const MainNavigation = () => {
    return (<header>
        <nav>
            <ul>
                <li><link to="/">Home</link></li>
                <li><link to="prod">Products</link></li>
                
            </ul>

        </nav>

    </header>);
}

export default MainNavigation;
